import React from 'react';
// import './component.css';

const Button = (props) => {
  const {
    className,
    children,
    ...rest
  } = props;

  return (
    <button
      className={className}
      {...rest}
    >
      {children}
    </button>
  );
};

Button.defaultProps = {
  className: 'Button'
};

export default Button;
